// Projects.js
import React from 'react';

const projects = [
    {
        title: 'Project One',
        description: 'A web app built with React and Node.js.',
        imageUrl: 'path/to/image',
        link: 'https://github.com/yourusername/project-one',
    },
    {
        title: 'Project Two',
        description: 'A responsive website built with HTML, CSS, and JavaScript.',
        imageUrl: 'path/to/image',
        link: 'https://github.com/yourusername/project-two',
    },
];

const Projects = () => {
    return (
        <section id="projects" className="py-20 bg-gray-100">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-center">Projects</h2>
                <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8">
                    {projects.map((project, index) => (
                        <div key={index} className="bg-white p-4 rounded shadow-md">
                            <img src={project.imageUrl} alt={project.title} className="w-full h-48 object-cover rounded" />
                            <h3 className="text-xl font-bold mt-4">{project.title}</h3>
                            <p className="mt-2">{project.description}</p>
                            <a href={project.link} target="_blank" rel="noopener noreferrer" className="text-blue-500 hover:underline mt-2 inline-block">View Project</a>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Projects;
